        Object.keys(dataImport).map((x,i) => {
            console.log(x);
            headers.push(<th>{x}</th>); 
        });

        console.log(Object.keys(dataImport));

        return headers; 

    }

    return(
    <React.Fragment>

        <p>Table</p>
        <table>
            <thead>
                <tr>{renderHeaders()}</tr>
            </thead>
        </table>
    </React.Fragment> 
    )
}

export default MainTable;
